svg.script:

if(window.parent && window.parent.Wincor && window.parent.Wincor.UI && window.parent.Wincor.UI.Content) {
    let styleRes = window.parent.Wincor.UI.Content.StyleResourceResolver;
    if(styleRes) {
    	let style = document.getElementsByTagName("style")[0];
      	style.innerHTML = style.innerHTML.replace("default/svg.css", styleRes.type() + "svg.css");
       styleRes = null;
    }
}


let id = this.frameElement && this.frameElement.parentElement ? this.frameElement.parentElement.id : "";
let clazz = this.frameElement && this.frameElement.parentElement ? this.frameElement.parentElement.attributes['class'] : "";
if(typeof clazz === "object") {
    clazz = clazz.nodeValue;
} else {
	clazz = "";
}
if(id === "buttonConfirm" || clazz.indexOf("buttonConfirm") !== -1 || id === "buttonConfirmPopup" || this.frameElement.className === "confirm") {
    document.getElementById("line1").setAttribute("class", "strokeColor06");
}
